// JavaScript Document
import jQuery from 'jquery';

jQuery.noConflict();
jQuery(document).ready(function () {

    'use strict';

	jQuery('.burgerBtn').click(function(){
		jQuery('.nav-menu').show("slow");
	});
	
	jQuery('.menu-close').click(function(){
		jQuery('.nav_menu').hide("slow");
	});
});
